using System;

public static class Snippet
{
	public static void saikeisan(AdvanceSoftware.ExcelCreator.Creator E_Creater)
	{
	E_Creater.FullCalcOnLoad = true;
	}
}

using System;

public static class Snippet
{
	public static void SousaSheetSet(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String SheetNamae, ref System.Int32 ixSheetNo)
	{
		ixSheetNo = E_Creater.SheetNo2(SheetNamae);
		if (ixSheetNo >= 0)
		{
			E_Creater.SheetNo = ixSheetNo;
		}
	}
}

using System;

public static class Snippet
{
	public static void FROM_EXCEL(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName, ref System.Int32 Num1, ref System.Double Num2, ref System.String Str1, ref System.String Str2)
	{
		Num1 = E_Creater.Cell(CellName).Long;
		Num2 = E_Creater.Cell(CellName).Double;
		Str1 = E_Creater.Cell(CellName).Str;
		Str2 = E_Creater.Cell(CellName).Str;
	}

}
